			Platformer.prototype.gotoNextLevel = function(ts) {
				
				
				this.charLayer.clearRect(0,0,496,496);
				
				this.player._autoAnimate = 1;
				this.player.move(this.controller.buttons.left , this.controller.buttons.right,this.controller.buttons.up || this.controller.buttons.a,this.controller.buttons.down);
				
				
				this.player._autoAnimate = 0;
				
				this.sceneryObjectRoutine();
				
				
				if( cat ) {
					
					cat.update();//update the x y and handle collision
					cat._canvasAnimation.matchPosition(cat);
					cat._canvasAnimation.animate(.5);
					cat._canvasAnimation.blit();
					
					if(tabageos.GeometricMath.testForPointInCircle(this.player._pos, 8, cat._pos)) {
						
						if(!this.player.holding && this.controller.buttons.b) {
							
							this.player.pickUp(cat);
							cat = null;
							
						}
					}
					
				}
				
				this.callCamera(ts);
				
				if(this._helperPoint.x == -7171) {
					level += 1;
					this.transitionToSceneByDoor(level, 400);
					this._helperPoint.x = 0;
				}
				
				
			};

			Platformer.prototype.sceneryObjectRoutine = function() {
				
				
				var i = 0; var obj;
				for(i;i<sceneryObjects.length;i++) {//move and interact with sceneryObejcts
					obj = sceneryObjects[i];//sceneryObjects is a reference to the stored array in the sceneChanger holding the SceneryObjects for the currentScene.
					
					
					if(!obj) break;//objects can be thrown quickly into other scenes, its remotely possible for them to be thrown fast enough to cause this, when transfering from sceneryObejcts to an array stored in the TileSceneChanger.
					
					
					if(obj.animationSpecs && (obj.currentAnimation == "spin" || obj.currentAnimation == "heart") ) { //a coin
						
						obj.animate(); 
						obj.blit();
						if(tabageos.GeometricMath.testForPointInCircle(this.player._pos, 4, obj.getPosition())) {
							coinsCollected += 1;
							cointext.innerText = coinsCollected + "";
							this.playSound("coin");
							if(obj.currentAnimation == "heart") {
								if(this.player.health < 56) {
									this.player.health += 2;
									heartsLine.style.width = (this.player.health * 3.2) +"px";
								}
							}
							tabageos.GeometricMath.splice(sceneryObjects, sceneryObjects.indexOf(obj));
							break;
						}
						
						
					} else { //a crate
						
						this.sceneChanger.sceneryObjectSceneChange(obj,sceneryObjects,8-4,496-4,0,0);//very handy method, allowing sceneryObejcts to be thrown into other scenes.
				
					
						if(!obj._grounded) { //until it lands on the ground, move the scenery object
								//no longer try to move horizontally once it reaches a horizontal collision
							if(obj._pLeft || obj._pRight) { obj.xDirection = -2; }
							
							if(obj._solidSit == -2) {//if it is in the air at the beginning of the scene fall down, used to fall on swith at beginning of some scene
								
								obj.move(0,0,0,1);
								if(obj._grounded) {
									obj._solidSit = 0;
								}
							} else {
							
								//move applies velocity ._veloc, in the desired direction.
								obj.move(obj.xDirection != -2 ? (obj.xDirection ? 0 : 1) : 0,  obj.xDirection != -2 ? obj.xDirection : 0,  0, 0, 1);
						
							}
						} else {
							
							
							tileUnder = tabageos.BlitMath.checkTileValueAt(obj.x-1,obj.y,this.sceneChanger.currentMap,8,8);
							if(tileUnder[0] == 15 && tileUnder[1] == 56) {
								
								greenSwitch = true;
								this.switchGreenBlocks(0);
							} else {
								tileUnder = tabageos.BlitMath.checkTileValueAt(obj.x+4,obj.y,this.sceneChanger.currentMap,8,8);
								if(tileUnder[0] == 15 && tileUnder[1] == 56) {
									greenSwitch = true;
									this.switchGreenBlocks(0);
								}
								
							}
							
							if(tileUnder[0] == 6 && tileUnder[1] == 67) {
								
								yellowSwitch = true;
								this.switchYellowBlocks(0);
							} else {
								tileUnder = tabageos.BlitMath.checkTileValueAt(obj.x+4,obj.y,this.sceneChanger.currentMap,8,8);
								if(tileUnder[0] == 6 && tileUnder[1] == 67) {
									yellowSwitch = true;
									this.switchYellowBlocks(0);
								}
								
							}
							
							if(tileUnder[0] == 15 && tileUnder[1] == 65) {
								
								redSwitch = true;
								this.switchRedBlocks(0);
							} else {
								tileUnder = tabageos.BlitMath.checkTileValueAt(obj.x+4,obj.y,this.sceneChanger.currentMap,8,8);
								if(tileUnder[0] == 15 && tileUnder[1] == 65) {
									redSwitch = true;
									this.switchRedBlocks(0);
								}
								
							}
							
						}
						
						obj._canvasAnimation.matchPosition(obj);
						obj._canvasAnimation.animate(.5);
						obj._canvasAnimation.blit();
						
						
						var exrec = obj.getRectangle(); exrec.x -= 1; exrec.width += 2;
						//if the player is not holding anything and e is pressed and it overlaps a sceneryObject, pick up the scenery object.
						if(!this.player.holding && (this.controller.buttons.b) && tabageos.GeometricMath.rectanglesOverlapAmount(exrec, this.player.getRectangle())/8 > 0) {
							this.controller.buttons.b = 0;
							tileUnder = tabageos.BlitMath.checkTileValueAt(obj.x-1,obj.y,this.sceneChanger.currentMap,8,8);
							//if it was on a switch at this point the player is picking it up, so release the switch.
							
							if(tileUnder[0] == 15 && tileUnder[1] == 56) {
								
								greenSwitch = false;
								this.switchGreenBlocks(1);
							} else {
								tileUnder = tabageos.BlitMath.checkTileValueAt(obj.x+4,obj.y,this.sceneChanger.currentMap,8,8);
								if(tileUnder[0] == 15 && tileUnder[1] == 56) {
									greenSwitch = false;
									this.switchGreenBlocks(1);
								}
							}
							
							if(tileUnder[0] == 6 && tileUnder[1] == 67) {
								
								yellowSwitch = false;
								this.switchYellowBlocks(1);
							} else {
								tileUnder = tabageos.BlitMath.checkTileValueAt(obj.x+4,obj.y,this.sceneChanger.currentMap,8,8);
								if(tileUnder[0] == 6 && tileUnder[1] == 67) {
									yellowSwitch = false;
									this.switchYellowBlocks(1);
								}
								
							}
							if(tileUnder[0] == 15 && tileUnder[1] == 65) {
								
								redSwitch = false;
								this.switchRedBlocks(1);
							} else {
								tileUnder = tabageos.BlitMath.checkTileValueAt(obj.x+4,obj.y,this.sceneChanger.currentMap,8,8);
								if(tileUnder[0] == 15 && tileUnder[1] == 65) {
									redSwitch = false;
									this.switchRedBlocks(1);
								}
								
							}
							
							var cfai = obj._fromEnemyAi+1-1;
							this.controller.buttons.b = 0;
							this.player.pickUp(obj);// pickUp() assigns the obejct to player.holding.
							this.player.holding._fromEnemyAi = cfai;
							sceneryObjects.splice(sceneryObjects.indexOf(obj),1);
							break;
							
						}
					
					
					}
				
				}
				
				if(this.player.holding) {//draw what the player is holding.
			
					this._helperRect.x = this.player.holding.tileValue[1] * 8;
					this._helperRect.y = this.player.holding.tileValue[0] * 8;
					this._helperRect.width = 8; this._helperRect.height = 8;
					this.charLayer.copyPixels(this._image,this._helperRect, this.player._pos);
			
				}
				
				
			};
			
			Platformer.prototype.loop = function() { 
				var i = 0;var obj;var b;var tileUnder;var coiner;var en;var mvpl;
				
				for(i; i < movingPlatforms.length;i++) {
					mvpl = movingPlatforms[i];
					if( (!(this.controller.buttons.up || this.controller.buttons.a) ) && tabageos.GeometricMath.rectanglesOverlapAmount(this.player.getRectangle(0,8), mvpl.getRectangle())/8 >= 1 ) {
						this.player._walkSpeed = mvpl._walkSpeed+1-1;
						this.player.maxSpeed = mvpl.maxSpeed+1-1;
						this.player._veloc.y = 0;//window.console.log(" pla ");
						this.player._grounded = 1;this.player._state = 2;
						if(mvpl._direcX != 0 || mvpl._direcY != 0) {
							this.player.move(mvpl._direcX == -1 ? 1 : 0, mvpl._direcX == 1, mvpl._direcY == -1 ? 1 : 0, mvpl._direcY == 1);
							this.player._pos.y = mvpl._pos.y - this.player.height;
							this.player.y = mvpl.y - this.player.height;
							this.player._veloc.y = 0;
							this.player._grounded = 1;this.player._state = 2;
						}
					} else {
						this.player._walkSpeed = 2;// + (tileW/16) - 1;
						this.player.maxSpeed = 12;// + (tileW/16) - 1;
					}
				}
			
				this.player.move(this.controller.buttons.left , this.controller.buttons.right,this.controller.buttons.up || this.controller.buttons.a,this.controller.buttons.down);
				
				if( this.controller.buttons.up && this.player._veloc.y < 0 && this.player._veloc.y > -2 ) {
					
					this.playSound("jump2", 1);
					
				}
				
				if(this.player.holding && this.controller.buttons.c) {//throw what the player is holding when q is pressed
					this.controller.buttons.c  = 0;
					obj = this.player.holding;//this.player.throwSceneryObjectTraveler();//this.player.throwSceneryObjectTraveler(16,16,1);
					obj.xDirection = this.player._leftRightFace == 1 ? 1 : 0;
					obj._jumpSpeed = 10;
					obj.setX(this.player.x);
					obj.setY(this.player.y);
					obj._jumps = 1;
					//obj._fromEnemyAi = -1;
					obj._canvasAnimation = new tabageos.CanvasAnimation(this._image,this.charLayer,null,obj.x,obj.y,8,8);
					obj._canvasAnimation.animationSpecs = this.getSceneryAnimation(obj.tileValue);
					obj._canvasAnimation.currentAnimation = "left";
					obj._map = this.player._map;
					obj._walkSpeed = Math.abs(this.player._veloc.x) >= this.player._walkSpeed ? 4 : 2;
					obj._veloc.y = -(Math.abs(this.player._veloc.y) < this.player._walkSpeed ? 2 : 3);obj._state = 3;
					obj._solidSit = 0;obj._eHit = 0;obj._grounded = 0;
					this.player._throwHolding();
					
					if(obj.tileValue[0] == 9 && obj.tileValue[1] == 63) {
						level = 3;
						this._helperPoint.x = -7171;
						this.levelComplete(this.gotoWarpLevel);
						return;
					}
					if(obj.tileValue[0] == 9 && obj.tileValue[1] == 65) {
						level = 4;
						this._helperPoint.x = -7171;
						this.levelComplete(this.gotoWarpLevel);
						return;
					}
					if(obj.tileValue[0] == 9 && obj.tileValue[1] == 67) {
						level = 1;this._helperPoint.x = -7171;
						this.levelComplete(this.gotoWarpLevel);
						return;
					}
					if(obj.tileValue[0] == 9 && obj.tileValue[1] == 69) {
						level = 5;this._helperPoint.x = -7171;
						this.levelComplete(this.gotoWarpLevel);
						return;
					}
					if(obj.tileValue[0] == 9 && obj.tileValue[1] == 61) {
						level = 8;this._helperPoint.x = -7171;
						this.levelComplete(this.gotoWarpLevel);
						return;
					}
					if(obj.tileValue[0] == 15 && obj.tileValue[1] == 37) {
						cat = obj;
						return;
					}
					sceneryObjects.push(obj);
					
				}
				
				if(this.player.holding && this.controller.buttons.b && (this.player.holding.tileValue[0] != 15 || this.player.holding.tileValue[1] != 37) ) {
				
					this.controller.buttons.b  = 0;
					obj = this.player.holding;//this.player.throwSceneryObjectTraveler();//this.player.throwSceneryObjectTraveler(16,16,1);
					obj.xDirection = -2;//this.player._leftRightFace == 1 ? 1 : 0;
					obj._jumpSpeed = 10;
					obj.setX(this.player.x);
					obj.setY(this.player.y);
					obj._jumps = 1;
					//obj._fromEnemyAi = -1;
					obj._canvasAnimation = new tabageos.CanvasAnimation(this._image,this.charLayer,null,obj.x,obj.y,8,8);
					obj._canvasAnimation.animationSpecs = this.getSceneryAnimation(obj.tileValue);
					obj._canvasAnimation.currentAnimation = "left";
					obj._map = this.player._map;
					obj._walkSpeed = Math.abs(this.player._veloc.x) >= this.player._walkSpeed ? 4 : 2;
					obj._veloc.y = -(Math.abs(this.player._veloc.y) < this.player._walkSpeed ? 2 : 3);obj._state = 3;
					obj._solidSit = 0;obj._eHit = 0;obj._grounded = 0;
					this.player._throwHolding();
					
					
					
					sceneryObjects.push(obj);
				
				}
				
				
				
				i = 0;
				this.sceneryObjectRoutine();
				
				
				i = 0;//moving platform movement and initial interactions
				for(i; i < movingPlatforms.length;i++) {
				
					mvpl = movingPlatforms[i];
					
					if(mvpl._horizontal) { 
					
						if(mvpl._pRight) {
							mvpl._direcX = mvpl._pLeft ? 0 : -1;
						} else if (mvpl._pLeft) {
							mvpl._direcX = 1;
						}
					} else {
						if(mvpl._atCeiling) { 
							mvpl._direcY = mvpl._grounded ? 0 : 1;
						} else if (mvpl._grounded) { 
							mvpl._direcY = -1;
						}
					}
					
					mvpl.move(mvpl._direcX == -1 ? 1 : 0, mvpl._direcX == 1, mvpl._direcY == -1 ? 1 : 0, mvpl._direcY == 1);
					
					//when holding up the player does not interact with moving platforms
					if( ( !(this.controller.buttons.up || this.controller.buttons.a) ) && tabageos.GeometricMath.rectanglesOverlapAmount(this.player.getRectangle(0,8), mvpl.getRectangle())/8 >= 1 ) {
						this.player._veloc.y = 0;
						this.player._grounded = 1;this.player._state = 1;
						
						this.player._walkSpeed = mvpl._walkSpeed+1-1;
						this.player.maxSpeed = mvpl.maxSpeed+1-1;
						
					} else {
						this.player._walkSpeed = 2;
						this.player.maxSpeed = 12;
					}
					mvpl._canvasAnimation.animate();
					mvpl._canvasAnimation.x = Math.round(mvpl.x+1-1);
                    mvpl._canvasAnimation.y = Math.round(mvpl.y+1-1);
					mvpl._canvasAnimation.blit(0,0,1);
				
				}
				
				i = 0;
				for(i;i<enemies.length;i++) {//enemies
					
					en = enemies[i];
					tabageos.GameSkeleton.seeAndChaseRoutine(en,enemies,this.player,this._helperPoint,128,0,48,en._map,8,8);
					
					if( this.player.hurt <= 0 && this.player._state == 3 && this.player.y + this.player.height >= en.y+1 && this.player.y < en.y && this.player.x >= en.x - 4 && this.player.x <= en.x + en.width+4 ) {
						
						this.player._grounded = 0;
						this.player._veloc.y = -5;this.player._state = 3; 
						if(en._canvasAnimation.fromWidthOffset == 16 && en._canvasAnimation.fromHeightOffset == 16) {
							en.health -= 10;
							if(en.health <= 0) {
								enemies.splice(enemies.indexOf(en), 1);
							}
						} else {
							enemies.splice(enemies.indexOf(en), 1);
						}
						break;
					} else if ( this.player.hurt <= 0 && tabageos.GeometricMath.testForPointInCircle(en._pos, 5, this.player._pos) ) {
						
						this.player.health -= 1;
						this.player.hurt = 100;
						this.player._grounded = 0;
						this.player._veloc.y = -3;this.player._state = 3; 
						heartsLine.style.width = (this.player.health * 3.2) +"px";
						if(this.player.health <= 0) {
							this.gameOver(1);
						}
						break;
					}
					
					if(en._canvasAnimation.fromHeightOffset == 16 && en._canvasAnimation.fromWidthOffset == 16) {
						en.bulletTime -= 33.3;
						if(en.bulletTime <= 0) {
							b = bullets.pop();
							b.setX( en.x );
							b.setY( en.y );
							b._map = en._map;
							b._canvasAnimation.currentAnimation = en._leftRightFace ? "right" : "left";
							b._veloc.x = en._leftRightFace ? 4 : -4;
							movingBullets.push( b );
							en.bulletTime = 4000;
						}
					}
					
					en._canvasAnimation.matchPosition(en);
					en._canvasAnimation.changeLeftRightUpDownAnimation(en._veloc.x < 0, en._veloc.x > 0,0,0);
					en._canvasAnimation.animate(.5);
					en._canvasAnimation.blit();
				}
				
				
				this.player._autoAnimate = 1;
				if(this.player.hurt > 0) {
					this.player.hurt -= 1;
					if(this.player.hurt % 2 == 0) {
						this.player.autoAnimation();
					}
				} else {
					this.player.autoAnimation();	
				}
				this.player._autoAnimate = 0;
				
					
					obj = tabageos.BlitMath.checkTileValueAt(this.player.x+4,this.player.y,this.sceneChanger.currentMap,8,8);
					if(obj[0] == 22 && obj[1] == 54 ) { //checkered flag spot
						this.player.setX(this.player.x - 8);
						this.player.setY(this.player.y - 64);
						//level +=1;
						//window.console.log(level);
						this._helperPoint.x = -7171;
						this.levelComplete(this.gotoNextLevel);
						return;
					} 
					
					if(npc) {
						//only happens on lv 5 to move the guy off the yellow switch
						if(!npc._grounded) {//initially he falls onto the switch when the level starts
							npc.move(0,0,0,1);
							npc._canvasAnimation.animate(.5);
							npc._canvasAnimation.matchPosition(npc);
							npc._canvasAnimation.blit();
						} else if(npc._grounded && npc.x == 368) {//so if he is grounded we know to activate the switch
							npc._canvasAnimation.animate(.5);
							npc._canvasAnimation.matchPosition(npc);
							npc._canvasAnimation.blit();
							if(!yellowSwitch) {
								yellowSwitch = true;
								this.switchYellowBlocks(0);
							}
						} else if(npc._grounded && npc.x < 368) {//when the player has enough coins and is over the bottom message spot the npc will be moved below.
							npc._canvasAnimation.animate(.5);
							npc._canvasAnimation.matchPosition(npc);
							npc._canvasAnimation.blit();
						}
						
					}
					
					//the cat is on level 9 initially, during placeScenery the cat is created
					//placeScenery happens when the scene changes, the GameSkeleton Class calls it for us, we connected the placeScenery method during contrsuction in the specs Object.
					//cat is a SceneryObjectTraveler which inherits from MapTraveler
					//so it can be picked up and thrown and move around
					if( (cat && !this.player.holding) || (cat && this.player.holding && (this.player.holding.tileValue[0] != cat.tileValue[0] || this.player.holding.tileValue[1] != cat.tileValue[1])) ) {
						
							if(this.player._leftRightFace) {//go the opposite way the player is looking
								cat._veloc.x = -2;
								cat._canvasAnimation.currentAnimation = "left";
							} else {
								cat._veloc.x = 2;
								cat._canvasAnimation.currentAnimation = "right";
							}
							cat._veloc.y = 0;//dont move vertically
							
							var tileUnderCat = tabageos.BlitMath.checkTileValueAt(cat.x + 2,cat.y + 2,this.sceneChanger.currentMap,8,8,this._helperPoint);
							if(tileUnderCat[0] == 0 && tileUnderCat[1] == 0) {
								cat._veloc.y = 2;//if there is not a tile under the cat, make the cat fall
								
							}
							
							cat.update();//update the x y and handle collision
							cat._canvasAnimation.matchPosition(cat);
							cat._canvasAnimation.animate(.5);
							cat._canvasAnimation.blit();
							
							if(tabageos.GeometricMath.testForPointInCircle(this.player._pos, 8, cat._pos)) {
								
								if(!this.player.holding && this.controller.buttons.b) {
									
									this.player.pickUp(cat);
									cat = null;
									
								}
							}
							
					}
					
					
					//speech tiles
					if(obj[0] == 9 && obj[1] == 73) {//level 5 tile at bottom of yellow stairs
						var lettera = (coinsCollected >= 250 || _levelOneThrown) ? "b" : "a"; 
						
						this.pixelParagraph(this.player.x - 48, this.player.y - 100,10,levelText["l"+level+lettera],this.charLayer);
						
						if (lettera == "b") {
							
							if(npc) {
								if(npc.x > 353) {
									npc.move(1,0,0,0);
									npc._canvasAnimation.animate(.5);
									npc._canvasAnimation.matchPosition(npc);
									npc._canvasAnimation.blit();
								} else {
									npc._canvasAnimation.animate(.5);
									npc._canvasAnimation.matchPosition(npc);
									npc._canvasAnimation.blit();
									if(yellowSwitch) {
										yellowSwitch = false;
										this.switchYellowBlocks(1);
									}
									if(!_levelOneThrown) {
										_levelOneThrown = 1;
										coinsCollected -= 250;
										cointext.innerText = coinsCollected + "";
									}
								}
								
							}

						}

					}
					
					
					if(  (obj[0] == 28 && obj[1] == 50) ) {//the leve 1 guy that wants the cat
						if(!this.player.holding && !cat) {
							this.pixelParagraph(this.player.x - 48, this.player.y - 100, 10, "I can't move. but I would love to. have the cat that. should be on level 9. I would give. 10,000 coins for it", this.charLayer);
						} else {
							if(this.player.holding && this.player.holding._fromEnemyAi == 2) {
								if(!cat) {
									this.pixelParagraph(this.player.x - 48, this.player.y - 100, 10, "That's a nice crate. I'll give you 10,000. for the cat on level 9", this.charLayer);
								} else {
									this.pixelParagraph(this.player.x - 48, this.player.y - 100, 10, "I know you want. to goto level 10. Thanks for bringing. The cat to. this level.", this.charLayer);
								
								}
								
							} else if (this.player.holding && this.player.holding._fromEnemyAi > 2 && this.player.holding._fromEnemyAi < 1000) {
								
								this.pixelParagraph(this.player.x - 48, this.player.y - 100, 10, "That is a warp cube. If you throw it. you will warp. to the cubes level. Once you use it. it can't be used again.", this.charLayer);
						
								
							} else if (this.player.holding && this.player.holding._fromEnemyAi == 1000) {
								
								
								this.pixelParagraph(this.player.x - 48, this.player.y - 100, 10, "That's the cat!. Aww!. It is so cute!", this.charLayer);
								if(coinsCollected < 10000) {
									coinsCollected += 10000;
									cointext.innerText = coinsCollected + "";
									
									
								}
								
							} else if (cat) {
								if(cat.y > 216) {
									this.pixelParagraph(this.player.x - 48, this.player.y - 100, 10, "The cat is here!. Could you let. me see it?.", this.charLayer);
								}
								if(cat.y <= 216) {
									this.pixelParagraph(this.player.x - 48, this.player.y - 100, 10, "Yay!. The cat!.", this.charLayer);
								
								}
							}
						}
					}
					
					if( (obj[0] == 28 && obj[1] == 53) ) {//level 10 interactions
						
						if(coinsCollected < 10000) {
							this.pixelParagraph(this.player.x - 32, this.player.y - 100, 10, "Hello... Thank you for. releasing the blocks.", this.charLayer);
						} else {
							this.pixelParagraph(this.player.x - 32, this.player.y - 100, 10, "Hello brave and. very rich warrior!. Thank you for. releasing me. Thanks for playing. You got the. best ending.", this.charLayer);
						}
					}
					
					if( (obj[0] == 25 && obj[1] == 59) ) {//level 6 first person
						
						
						this.pixelParagraph(this.player.x - 32, this.player.y - 100, 10, "There are only 2. crates on this level. but you need 3. to exit this level.", this.charLayer);
						
						
					}
					
					
					if( (obj[0] == 24 && obj[1] == 52) ) {//level 6 second person
						
						this.pixelParagraph(this.player.x - 32, this.player.y - 100, 10, "You can use the warp. close to a crate. then real fast pick up. the crate and it. will warp with you. Things you carry. also go with you. when leaving a level", this.charLayer);
						
						
					}
					
					
					if( (obj[0] == 5 && obj[1] == 46) || (obj[0] == 5 && obj[1] == 45) ) {//level 1 intro sign
						
						this.pixelParagraph(this.player.x - 32, this.player.y - 100, 10, "Welcome to Tmenya. "+ (!this.device ? "Use wasd to move. E to pick up. Q to throw." : "Use the arrows to move. a to jump. b to pick up. c to throw."), this.charLayer);
						
						
						
					}
					
					if( (obj[0] == 5 && obj[1] == 43) || (obj[0] == 5 && obj[1] == 44) ) {//level 2 platforms info
						
						this.pixelParagraph(this.player.x - 32, this.player.y - 100, 10, "When jumping onto. moving platforms. do not hold. the up button", this.charLayer);
						
						
						
					}
					
					
					if( (obj[0] == 5 && obj[1] == 47) || (obj[0] == 5 && obj[1] == 48) ) {//level 1 crate sign
						
						this.pixelParagraph(this.player.x - 32, this.player.y - 100, 10, "You can pick up. and throw crates."+ (!this.device ? "Use the E key. to pick up. And q to throw" : "Use b to pick up. And c to throw."), this.charLayer);
						
						
						
					}
					
					if( (obj[0] == 5 && obj[1] == 49) || (obj[0] == 5 && obj[1] == 50) ) {//level 1 warp cube sign
						
						this.pixelParagraph(this.player.x - 32, this.player.y - 100, 10, "Warp cubes will warp. you to another level."+ (!this.device ? "Press e to pick up. Then q would warp you." : "Press b to pick up. Then c would warp you.") + "You shouldn't pick it up. unless your ready to warp. There are 5. total warp cubes", this.charLayer);
						
					}
				
			};
		
			tabageos.loadSpriteSheetAndStart("gameSpriteSheet.png",1280,1280, function(e) {
				document.getElementById("phld").setAttribute("style", "display:none");
				new Platformer();
			});
			
		})();
		</script>
	</body>
</html>
